import axios from 'axios'
import React, { useEffect, useState } from 'react'
import Navbar from '../Componenet/Navbar'
import { useNavigate } from 'react-router-dom'


const Home = () => {

  const [ulke, setUlke] = useState([])

  useEffect(() => {
    const api_Link = "https://countriesnow.space/api/v0.1/countries"
    axios.get(api_Link)
      .then(response => {
        setUlke(response.data)
      })

  }, [])

  console.log(ulke, "yulkekk");


  return (
    <><br />
      <Navbar />

      {
        ulke.data?.map((ulke, i) =>
          <ul>
            <li>
              {ulke.country}
            </li>
          </ul>

        )
      }


    </>
  )
}

export default Home;
